import React from 'react';

import web from "./images/restaurant-mockup1.png";

import { NavLink } from "react-router-dom";
import Common from './Common';

const About = () => {
  return(
    <>
       <Common 
           name = 'Welcome to About Page'
           vlog = 'This website is created for not only Jains, but anyone interested in pursuing a 
                      healthy compassionate lifestyle through a plant-based diet.
                      Is there a dish you really love and want to know how to turn Jain?' 
           imgsrc = {web}
           visit = "/Contact" 
           btname = "Contact Now"
       />
    </>
  )
};

export default About;
